import React, { useEffect, useState, useRef } from "react";

import IconButton from '@mui/material/IconButton';
import SvgIcon from '@mui/material/SvgIcon';

function SvgButton(props) {

  let typeList = useRef(
    {"blank": "",
     "menu": "M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z",
     "tree": "m12 24h12z m0,9h6z m6 0h18zv18z m12 18h-12zv-6zv6z m12 12h12z "}
  )

  let [type, setType] = useState(typeList.current["blank"])

  useEffect(() => {
    if (Object.keys(typeList.current).includes(props.type)) {
      setType(typeList.current[props.type])
    } else {
      setType(typeList.current["blank"])
    }
  }, [props.type])

  return (
<p>
  Menu:&nbsp;
  <IconButton size="small" sx={{width: 24, height: 24, backgroundColor: "#ddd", boxShadow: "-1px 1px 2px", "&:hover": {boxShadow: "-2px 2px 3px", backgroundColor: "#eee"}}}>
    <SvgIcon>
      <path d={type} stroke="black"></path>
    </SvgIcon>
  </IconButton>
</p>
  )
}

export default SvgButton;
